import { useContext } from "react";

import { CartContext } from "../../contexts/Cart.context";

const CheckoutPage = () => {
  const { cartItems } = useContext(CartContext);
  return (
    <div>
      <h1>Check-Out Page</h1>
      {cartItems.map((item) => {
        <div>
          <h2>{item}</h2>
        </div>;
      })}
    </div>
  );
};

export default CheckoutPage;
